import React, { useState, useEffect } from 'react'
import axios from 'axios'

const Home = () => {

  const [isLoged, setIsLoged] = useState(null)

  const token = localStorage.getItem('token')

  useEffect(() => {
    setIsLoged(token)
  }, [])
  return (
    <div>
      {!isLoged ?
        <h1>Not Loged</h1> :
        <h1>Is Loged</h1>}
    </div>
  )
}

export default Home
